/* begin: ../../blocks.05-project/filter-slider/filter-slider.js */
window.iv = window.iv || {};
window.iv.ui = window.iv.ui || {};

window.iv.ui.filterSlider = {
    init: function () {

        var allFilter = $(".filter-slider");

        allFilter.each(function (i, el) {
            var $el = $(el);
            var filterSlider = $el.find(".filter-slider__slider");
            var inputMin = $el.find('.filter-slider__input-min'),
                inputMax = $el.find('.filter-slider__input-max');

            var valuesMin = +inputMin.val(),
                valuesMax = +inputMax.val(),
                priceMin = +inputMin.data('price-min'),
                priceMax = +inputMax.data('price-max');


            var valuesMinTemp = valuesMin ? valuesMin : priceMin;
            var valuesMaxTemp = valuesMax ? valuesMax : priceMax;

            var isFloat = $el.hasClass('filter-slider_float') ? true : false;
            
            var stepSlider = isFloat ? 0.1 : 1;
            
            filterSlider.slider({
                range: true,
                min: priceMin,
                max: priceMax,
                step: stepSlider,
                values: [valuesMinTemp, valuesMaxTemp],
                slide: function (event, ui) {
                    inputMin.val(ui.values[0]);
                    inputMax.val(ui.values[1]);
                }
            });
            if (inputMin.val()) {
                inputMin.val(filterSlider.slider("values", 0));
            }
            if (inputMax.val()) {
                inputMax.val(filterSlider.slider("values", 1));
            }


            inputMin.on('change', function () {
                var count = isFloat ? +($(this).val()) : parseInt($(this).val());
                count = isNaN(count) ? 0 : count;
                $(this).val(count);
                if (count <= filterSlider.slider("values", 1)) {
                    filterSlider.slider("values", 0, $(this).val());

                    if (count < priceMin) {
                        filterSlider.slider("values", 0, priceMin);
                        $(this).val(priceMin)
                    }
                } else {
                    filterSlider.slider("values", 0, inputMax.val());
                    $(this).val(inputMax.val())
                }
            });

            inputMax.on('change', function () {
                // var count = parseInt($(this).val());
                var count = isFloat ? +($(this).val()) : parseInt($(this).val());
                count = isNaN(count) ? priceMax : count;
                $(this).val(count);
                if (count >= filterSlider.slider("values", 0)) {
                    filterSlider.slider("values", 1, $(this).val());

                    if (count > priceMax) {
                        filterSlider.slider("values", 1, priceMax);
                        $(this).val(priceMax)
                    }
                } else {
                    filterSlider.slider("values", 1, inputMin.val());
                    $(this).val(inputMin.val())
                }
            })
        });
    }
};


$(function () {
    window.iv.ui.filterSlider.init();
});;
/* end: ../../blocks.05-project/filter-slider/filter-slider.js */


/* begin: ../../blocks.04-common/cart-control/cart-control.js */
window.medstar = window.medstar || {};
window.medstar.ui = window.medstar.ui || {};
window.medstar.ui.cartControl = window.medstar.ui.cartControl || {};

window.medstar.ui.cartControl = {
    /**
     * data-min минимальное количество (default: 0),  data-max - максимальное (default: false)
     * @param elem
     */
    minus: function (elem) {
        var $input = $(elem).parent().find('input'),
            min = $input.data('min') || 0;
        var count = parseInt($input.val()) - 1;
        count = count < min ? min : count;
        $input.val(count);
        $input.change();
    },
    plus: function (elem) {
        var $input = $(elem).parent().find('input'),
            max = $input.data('max');
        var count = parseInt($input.val()) + 1;
        if (max) {
            count = count > max ? max : count; //если нужно ограничить колличество
        }
        $input.val(count);
        $input.change();
    },
    changeFilter: function (elem) {
        var $this = $(elem);
        var count = parseInt($this.val());
        count = isNaN(count) ? 0 : count;
        //count = count > 1000 ? 1000 : count; //если ограничить колличество
        $this.val(count);
        if (count != 0) {
            $(elem).parents('[data-product]').addClass('selected');
        } else {
            $(elem).parents('[data-product]').removeClass('selected');
        }
    },
    /**
     *
     * @param {jQuery} input
     */
    wait: function (input) {
        input.closest('.cart-control').addClass('cart-control_wait');
    },
    /**
     *
     * @param {jQuery} input
     */
    waitEnd: function (input) {
        input.closest('.cart-control').removeClass('cart-control_wait');
    }
};
/**
 * data-product установить на элемент который нужно выделить при input > 0, класс "selected" сам по себе не имеет стилей, работает в зависимостях с другими классами
 */


$(function () {
    var isIOS = ((/iphone|ipad/gi).test(navigator.appVersion));
    var myDown = isIOS ? "touchstart" : "click";
    $('.cart-control__minus').on(myDown, function (e) {
        e.preventDefault();
        window.medstar.ui.cartControl.minus(this);
    });

    $('.cart-control__plus').on(myDown, function (e) {
        e.preventDefault();
        window.medstar.ui.cartControl.plus(this);
    });

    $(".cart-control__input").change(function (e) {
        e.preventDefault();
        // window.medstar.ui.cartControl.changeFilter(this); // тут заблокирован инпут
    })

});;
/* end: ../../blocks.04-common/cart-control/cart-control.js */
